import React, {Component} from 'react';
import CytoscapeComponent from 'react-cytoscapejs';
import cola from 'cytoscape-cola';
import Tooltip from 'react-qtip';





class CytoContainer extends Component{
    constructor(props){
        super(props);

        }




  render(){
    const data =JSON.stringify(this.props.cy_data);
    //JSON.parse(data);
    const elements = [
       { data: { id: 'one', label: 'Hello' }, position: { x: 0, y: 0 } },
       { data: { id: 'two', label: 'hiya 2' }, position: { x: 100, y: 0 } },
       { data: { source: 'one', target: 'two', label: 'Edge from Node1 to Node2' } }
    ];
    const layout = {name: 'cola' };



    return (
        <CytoscapeComponent
  elements={[...elements]}
  style={ { width: '600px', height: '600px' } }
  layout={layout}
/>  
  );
}
}


export default CytoContainer;
